;; @@
(def data_theta1 (mapv #(vector (first %))
               (csv/slurp-csv "data/mma_double.csv"
                              :header false
                              :cast-fns {0 #(Double/parseDouble %) 1 #(Double/parseDouble %)})))
(def t-step 0.1)


(def data_omega1 (mapv #(vector (second %))
               (csv/slurp-csv "data/mma_double.csv"
                              :header false
                              :cast-fns {0 #(Double/parseDouble %) 1 #(Double/parseDouble %)})))
(def dat
  				(csv/slurp-csv "data/mma_double.csv"
                              :header false
                              :cast-fns {0 #(Double/parseDouble %) 1 #(Double/parseDouble %)}))

                       

(def t-step 0.1)

(def m1 1)
(def m2 1)
(def l1 0.5)
(def l2 1)
(def g 1)
